import React, { useEffect, useState } from "react";
import { Camera, useCameraDevice } from "react-native-vision-camera";
import { Alert, Button, Image, SafeAreaView, ScrollView, StyleSheet, Text, TouchableOpacity, View } from "react-native";
import Pdf from 'react-native-pdf';
import Sound from 'react-native-sound';
import Orientation from "react-native-orientation-locker";



const initialText = "您所购买的是蓝洋人寿保险股份有限公司的保险产品。您所投保的险种有：A欣享未来(7.0版)全能保B蓝洋1号资金信托计划。主附险的缴费频次缴费期、期交保费保险期间等信息都已经在投保单上分别列明，请问您清楚了吗?";
const sound_gif = require('./assets/sound.gif');
const mic_gif = require('./assets/mic.gif');


function PdfPage({navigation}): React.JSX.Element {
  let device = useCameraDevice('front');
  let isActive = true;

  const [rightText, setRightText] = useState(initialText);
  const [rightGif, setRightGif] = useState(sound_gif);


  useEffect(() => {
    stage7();
    Camera.requestCameraPermission();
    Orientation.lockToLandscapeRight();
  }, []);


  const stage7 = () => {
    const sound = new Sound(require('./assets/stage7.mp3'), (error) => {
      if (!error) {
        sound.play((success) => {
          sound.release();
          if (success) {
            console.log('音频7播放完成');
          }
          setRightGif(mic_gif);
          setTimeout(stage8, 1500);
        });
      }
    });
  };

  const stage8 = () => {
    setRightGif(sound_gif);
    const sound = new Sound(require('./assets/stage8.mp3'), (error) => {
      if (!error) {
        sound.play((success) => {
          sound.release();
          if (success) {
            console.log('音频8播放完成');
          }
          // setTimeout(stage9, 1500);
        });
      }
    });
  };

  let source = {uri:"data:application/pdf;base64,"};

  return (
    <SafeAreaView>
      <View style={{marginTop: 0, height: "100%"}}>
        <View style={{flexDirection: 'row', alignItems: 'stretch'}}>
          <View style={{flex: 5}}>
            <View style={{
              position: 'absolute', // 绝对定位
              bottom: 0, // 定位到图片顶部
              left: 0, // 定位到图片左侧
              right: 0, // 定位到图片右侧
              height: '20%', // 高度为屏幕高度的5%
              backgroundColor: 'rgba(128, 128, 128, 0.5)', // 灰色透明背景
              flexDirection: 'row',
              justifyContent: 'space-between',
              alignItems: 'center',
              paddingHorizontal: 10,
              zIndex: 9999
            }}>
              <Text style={{ color: '#FFFFFF', fontSize: 15 }}>为保障您的权益，请客户亲自滑屏仔细阅读，他人不可代为操作。</Text>
              <View style={{ flexDirection: 'row' }}>
                <TouchableOpacity style={styles.button1} onPress={() => navigation.navigate('PdfPage')}>
                  <Text style={styles.buttonText}>刷新</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.button2} onPress={() => navigation.navigate('PdfPageDisclaimer')}>
                  <Text style={styles.buttonText}>核对完毕</Text>
                </TouchableOpacity>
              </View>
            </View>
            <Pdf
              source={source}
              scale={2}
              onLoadComplete={(numberOfPages,filePath) => {
                console.log(`Number of pages: ${numberOfPages}`);
              }}
              onPageChanged={(page,numberOfPages) => {
                console.log(`Current page: ${page}`);
              }}
              onError={(error) => {
                console.log(error);
              }}
              onPressLink={(uri) => {
                console.log(`Link pressed: ${uri}`);
              }}
              style={styles.pdf}/>
          </View>

          <View style={{flex: 1, marginLeft: 10, marginRight: 5}}>
            <View  style={{height: "25%", marginBottom: 5}}>
              <Camera
                style={[StyleSheet.absoluteFill, {height: "100%"}]}
                device={device}
                isActive={isActive}
              />
            </View>
            <View style={{  marginLeft: 10,  height: "75%" }}>
              <View style={{ height: '100%' }}>
                <Image resizeMode={'stretch'} style={{ width: '100%', height: '100%' }} source={rightGif}></Image>
              </View>
            </View>
          </View>
        </View>
      </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'flex-start',
    alignItems: 'center',
    marginTop: 25,
  },
  pdf: {
    flex:1,
    width: '100%'
  },
  button1: {
    backgroundColor: "#367bd8",
    padding: 10,
    marginHorizontal: 5,
    borderRadius: 5
  },
  button2: {
    backgroundColor: "#ff361e",
    padding: 10,
    marginHorizontal: 5,
    borderRadius: 5
  },
  buttonText: {
    color: "#FFFFFF",
    fontSize: 15
  }
});

export default PdfPage;
